import React from 'react';

function CardDetails(props) {
  const { src, text, label } = props.location.state;

  return (
    <div className='card-details'>
      <img src={src} alt={label} />
      <h2>{label}</h2>
      <p>{text}</p>
    </div>
  );
}

export default CardDetails;
